import schema from "api/schema";

export const Event = schema({
    type: "object",
    properties: {
        "queueStartedAt": {
            type: "integer"
        },
        "ordinal": {
            type: "integer"
        },
        "sentAt": {
            type: "integer"
        },
        "type": {
            type: "string"
        }
    },
    additionalProperties: false,
    required: ["queueStartedAt", "ordinal", "type"]
});
